import React, { Component } from 'react';
import ResultsAPI from "../../API/ResultsAPI";
import F1InfoAPI from "../../API/InfoAPI";

class RecentResults extends Component<any,any> {
    constructor(props: any) {
        super(props);
        this.state = {
            recentinfo: [],
        };
    }

    async componentDidMount() {
        const resultApi: ResultsAPI = new ResultsAPI()
        const recentinfo: any[] = await resultApi.Recent();
        this.setState({ recentinfo });
        console.log("Recent Info:", recentinfo);
    }

    render() {
        setTimeout(()=>{
            const {recentinfo} = this.state
            console.log(recentinfo.length)
            console.log("in timeout")
            ;}, 1000)
        const {recentinfo} = this.state
        console.log(recentinfo.length);
        if(recentinfo.length == 0){
            return(
                <div>LOADING...</div>
            )
        }
        console.log(recentinfo)
        return (
            <div className={"flex flex-raw justify-center h-[50%] w-[70%] p-10 "}>
                {recentinfo.map((elem: any, key:number)=>(
                    <div key={key}>
                        {elem.number}
                        {elem.constructor}
                        {elem.driver}
                        {elem.points}
                        {elem.position}
                        {elem.status}
                    </div>
                ))}
            </div>
        );
    }
}

export default RecentResults;
